import React from "react";

function Home() {
    return(
        //The first section, the middle section and the last section of the home page
        <>
        <div className="HeadOne">
          <h1>Welcome to Sale Sphere.</h1>
          <p>Introducing Sale Sphere, a cutting-edge e-commerce platform that delivers products directly to your doorstep.</p>
        </div>
        <div className="MiddleTwo">
          <div className="Guard">
            <h1>A better way to shop anywhere on Earth.</h1>
            <p>This website offers you an elevated and more convenient shopping experience, allowing you to browse and make purchases with greater ease and satisfaction.</p>
            <button><link>Shop</link></button>
          </div>
        </div>
        <div className="LastThree">
        </div>  
        </>
    )
}

export default Home;
